import { createEffect } from "effector";

import { uuid } from "./state";

const getUUID = createEffect(() => {
  localStorage.setItem("uuid", "c426028e-e989-457c-84a2-0f4af85eafa4");
  return localStorage.getItem("uuid");
});

uuid.on(getUUID, (_, v) => v);

getUUID();
